  return (
    <div className='card' >
      <div className='card-image'>
        <Skeleton height="100%" width="100%" />
      </div>
      <h2>
        <Skeleton text-align="center" font-size="1.5rem" margin-bottom="8px" />
      </h2>
      <p>
        <Skeleton font-size="1rem" />
      </p>
    </div>
  )
}

